	add("extender", "{\"term\":\"extender\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|extend|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various substances designed to extend any of several properties of a material\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various components designed to extend the length of a device\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any substance added to food to bulk it out, with a higher protein content than a filler\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Soy protein is used as a meat \u0027\u0027extender\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A runner, or quick-draw. (from sense\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A phrase that extends an expression to include further members of a set, e.g. \u0026quot;and stuff\u0026quot;, \u0026quot;or something\u0026quot\", \"priority\":6}]}, \"synonyms\":{}}");

	add("extension", "{\"term\":\"extension\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|estension}}, from Latin {{m|la|extensiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of extending or the state of being extended; a stretching out; enlargement in breadth or continuation of length; increase; augmentation; expansion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That property of a body by which it occupies a portion of space (or time, e.g. \u0026quot;spatiotemporal extension\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Capacity of a concept or general term to include a greater or smaller number of objects; \u0026amp;mdash; correlative of intension\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In addition to concepts and conceptual senses, Frege holds that there are extensions of concepts. Frege calls an extension of a concept a ‘course of values’. A course of values is determined by the value that the concept has for each of its arguments. Thus, the course of values for the concept \u0027__ is a dog\u0027 records that its value for the argument Zermela is the True and for Socrates is the False, and so on. If two concepts have the same values for every argument, then their courses of values are the same. Thus, courses of values are extensional\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A written engagement on the part of a creditor, allowing a debtor further time to pay a debt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The operation of stretching a broken bone so as to bring the fragments into the same straight line\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An exercise in which an arm or leg is straightened against resistance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A simple offensive action, consisting of extending the weapon arm forward\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A numerical code used to specify a specific telephone in a telecommunication network\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A file extension\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Files with the \u0027.txt\u0027 \u0027\u0027extension\u0027\u0027 usually contain text\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An optional software component that adds functionality to an application\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"a browser \u0027\u0027extension\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The set of tuples of values that, used as arguments, satisfy the predicate\", \"priority\":14}]}, \"synonyms\":{}}");

	add("extensionality", "{\"term\":\"extensionality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The principle that objects are equal if and only if their observed properties are the same, regardless of internal processes that lead to those properties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The principle that functions are equal if and only if they operate on the same domain and for any given element of the domain the result of each of the functions is the same\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The principle, codified in the axiom of extensionality, that sets are equal if and only if they contain the same elements\", \"priority\":3}]}, \"synonyms\":{}}");

	add("extent", "{\"term\":\"extent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027extente\u0027 from Old french (842-ca. 1400) \u0027estente\u0027 (lang\u003dfro) from \u0027extendre\u0027 (lang\u003dfro) from Latin \u0027extendere\u0027 (See \u0027\u0027 )\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A range of values or locations\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The space, area, volume, etc., to which something extends\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027extent\u0027\u0027 of his knowledge of the language is a few scattered words\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1827\u0027\u0027, \u0027Universal Geography, or A Description of All the Parts of the World, on a New Plan\u0027, Edinburgh: Adam Black, volume 6, book 101\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The surface of the Balaton and the surrounding marshes is not less than 24 German square miles, or 384 English square miles; its principal feeder is the Szala, but all the water it receives appears inconsiderable relatively to its superficial \u0027\u0027extent\u0027\u0027, and the quantity lost in evaporation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"date\u003d14 November passage\u003d[S]he [Edwina, mother of ] was indeed Amanda [Wingfield, character in Williams\u0027 play \u0027\u0027] in the flesh: a doughty chatterbox from Ohio who adopted the manner of a Southern belle and eschewed both drink and sex to the greatest \u0027\u0027extent\u0027\u0027 possible\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A contiguous area of storage in a file system\", \"priority\":7}]}, \"synonyms\":{}}");

