	add("extermination", "{\"term\":\"extermination\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027extermination\u0027 from Latin \u0027exterminatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of exterminating; total destruction; eradication; excision; as, the extermination of inhabitants or tribes, of error or vice, or of weeds from a field\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Elimination\", \"priority\":2}]}, \"synonyms\":{}}");

