	add("extract", "{\"term\":\"extract\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027extractum\u0027 neuter perfect passive participle of {{m|la|extrahō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is extracted or drawn out\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A portion of a book or document, incorporated distinctly in another work; a citation; a quotation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A decoction, solution, or infusion made by drawing out from any substance that which gives it its essential and characteristic virtue; essence; as, extract of beef; extract of dandelion; also, any substance so extracted, and characteristic of that from which it is obtained; as, quinine is the most important extract of Peruvian bark\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A solid preparation obtained by evaporating a solution of a drug, etc., or the fresh juice of a plant; -- distinguished from an abstract\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A peculiar principle (fundamental essence) once erroneously supposed to form the basis of all vegetable extracts; -- called also the extractive principle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Ancestry; descent\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A draft or copy of writing; a certified copy of the proceedings in an action and the judgment therein, with an order for execution\", \"priority\":7}]}, \"synonyms\":{}}");

	add("extraction", "{\"term\":\"extraction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027estraction\u0027 from \u0027extractio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of extracting or the condition of being extracted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s origin or ancestry\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Larissa Remennick, \u0027Russian Israelis: Social Mobility, Politics and Culture\u0027, Routledge (ISBN 9781317977698), page 14\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Our companion on these tours was a young tourist, an American of Russian \u0027\u0027extraction\u0027\u0027, whose questions and remarks drew our attention to some details of Haifa life that have become too familiar and would have otherwise passed unnoticed.\u0026amp;nbsp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something extracted, an extract, as from a plant or an organ of an animal etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They [books] do preserve as in a vial the purest efficacy and \u0027\u0027extraction\u0027\u0027 of that living intellect that bred them\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An act of removing someone from a hostile area to a secure location\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A removal of a tooth from its socket\", \"priority\":9}]}, \"synonyms\":{}}");

